import React,{Component} from 'react';
import './Newbottom.css'
import {
    BrowserRouter as Router,
     Link
  } from "react-router-dom";
class NewBottom extends Component{
    render(){
        return(
            <div className="new-bottom">
                <div className="row">
                    <div className='col ab1'>
                        <Link to="/shirt"><img className="img1" src="http://localhost:4000/anh/ao"></img></Link>
                    </div>
                    <div className='col ab2'>
                    <Link to="/trouser"><img className="img1" src="http://localhost:4000/anh/quan"></img></Link>
                    </div>
                </div>
                <div className="row-2 ab3">
                <Link to="/shirt"><img className="img1" src="http://localhost:4000/anh/vay"></img></Link>
                </div>
            </div>
        )
}}
export default NewBottom
